import React, { Component } from 'react';

function Navbar(){
    return(
        <nav class="navbar bg-light">
            <div class="container">
                <img src={this.props.logo} alt="kebab" width="30" height="24"/>
            </div>
        </nav>
    );
}

export default Navbar;
